import RecipesByIngredient from './RecipesByIngredient.js';


const RecipesByIngredientsList = (props) => {

    const RecipeByIngredientsComponents = props.recipesInfo.map((recipeInfo) => {
        return <RecipesByIngredient recipeDetails={recipeInfo} />
    });

    return (
        <>
            {RecipeByIngredientsComponents}
        </>
    );
}

export default RecipesByIngredientsList
